import React, {useState} from 'react'
import Card from './Card'
import Navbar from './Navbar'

function MainPage() {

  const [events, setEvents] = useState([])

  const users = [
    {
      id: 1,
      name: "Rashford Marcus",
      age: 25,
      from: "England",
      job: "Web developer",
      gender: "male",
    },
    {
      id: 2,
      name: "Jorj",
      age: 25,
      from: "German",
      job: "Full stack",
      gender: "male",
    },
    {
      id: 3,
      name: "Joe Bayden",
      age: 25,
      from: "French",
      job: "Web design",
      gender: "Female",
    }
  ];

  const handleDelete =(id)=>{
    let newUsers = users.filter((value) => value.id !== id)
    setEvents(newUsers)
  }
  return (
    <>
        <Navbar />
        <Card handleDelete={handleDelete} />
    </>
  )
}

export default MainPage
